import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom"; // ÌéòÏù¥ÏßÄ Ïù¥ÎèôÏùÑ ÏúÑÌïú ÌõÖ
import config from "../config";
import styles from "../Style/register.module.css";
import fetchHelper from "../utils/fetchHelper";

export default function Register() {
  const navigate = useNavigate(); // ÌéòÏù¥ÏßÄÏù¥Îèô userNavigate()

  const [isKakaoLoaded, setIsKakaoLoaded] = useState(false);
  const [isPostcodeLoaded, setIsPostcodeLoaded] = useState(false);

  const [userInfo, setUserInfo] = useState({
    userid: "",
    password: "",
    email: "",
    sex: "",
    region1: "",
    region2: "",
    birth: "",
  });

  // ÌòÑÏû¨ ÎÇ†Ïßú Í∏∞Ï§ÄÏúºÎ°ú ÏµúÏÜå 1ÎÖÑ Ï†Ñ ÎÇ†Ïßú Í≥ÑÏÇ∞ (Ïò§Îäò ÎÇ†ÏßúÎÇò ÎØ∏Îûò ÎÇ†Ïßú ÏÑ†ÌÉùÏãú Îç∞Ïù¥ÌÑ∞Î≤†Ïù¥Ïä§Ïóê Î∂ÄÏ†ÅÏ†àÌïú Í∞íÏù¥ Ï†ÅÏö©Îê®Îê®)
  const minBirthDate = new Date();
  minBirthDate.setFullYear(minBirthDate.getFullYear() - 100); // ÏµúÎåÄ 100ÎÖÑ Ï†ÑÍπåÏßÄ ÏûÖÎ†• Í∞ÄÎä•
  const maxBirthDate = new Date();
  maxBirthDate.setFullYear(maxBirthDate.getFullYear() - 1); // ÏµúÏÜå 1ÏÇ¥Î∂ÄÌÑ∞ Í∞ÄÏûÖ Í∞ÄÎä•

  useEffect(() => {
    const kakaoApiKey = process.env.REACT_APP_KAKAO_API_KEY;
    if (!kakaoApiKey) {
      console.error(
        "üö® Kakao API ÌÇ§Í∞Ä ÏÑ§Ï†ïÎêòÏßÄ ÏïäÏïòÏäµÎãàÎã§! .env ÌååÏùºÏùÑ ÌôïÏù∏ÌïòÏÑ∏Ïöî."
      );
      return;
    }

    const script = document.createElement("script");
    script.src = `https://dapi.kakao.com/v2/maps/sdk.js?appkey=${kakaoApiKey}&libraries=services`;
    script.async = true;
    script.onload = () => setIsKakaoLoaded(true);
    script.onerror = () => console.error("üö® Kakao Map API Î°úÎìú Ïã§Ìå®!");

    document.head.appendChild(script);

    const loadPostcodeScript = () => {
      if (window.daum && window.daum.Postcode) {
        setIsPostcodeLoaded(true);
        return;
      }

      const script = document.createElement("script");
      script.src =
        "https://t1.daumcdn.net/mapjsapi/bundle/postcode/prod/postcode.v2.js";
      script.async = true;
      script.onload = () => setIsPostcodeLoaded(true);
      script.onerror = () => console.error("üö® Ïö∞Ìé∏Î≤àÌò∏ API Î°úÎìú Ïã§Ìå®!");

      document.body.appendChild(script);
    };

    loadPostcodeScript();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUserInfo({
      ...userInfo,
      [name]: value,
    });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await fetchHelper(`http://${config.SERVER_URL}/userinfo/register`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(userInfo),
      });

      if (response === "network-error") {
        navigate("/error/500");
        throw new Error("Network error");
      } else if (response === 404) {
        navigate("/error/404");
        throw new Error("404 Not Found");
      } else if (response === 500) {
        navigate("/error/500");
        throw new Error("500 Internal Server Error");
      } else if (response === 503) {
        navigate("/error/503");
        throw new Error("503 Service Unavailable");
      } else if (response.ok) {
        alert("ÌöåÏõêÍ∞ÄÏûÖÏù¥ ÏÑ±Í≥µÏ†ÅÏúºÎ°ú ÏôÑÎ£åÎêòÏóàÏäµÎãàÎã§.");
        console.log("User registered successfully");
        navigate("/login");
      } else {
        alert("ÌöåÏõêÍ∞ÄÏûÖ Ïã§Ìå®! ÏûÖÎ†•Ìïú Ï†ïÎ≥¥Î•º Îã§Ïãú ÌôïÏù∏Ìï¥Ï£ºÏÑ∏Ïöî.");
        console.error("Failed to register user");
      }
    } catch (error) {
      alert("Í¥ÄÎ¶¨ÏûêÏóêÍ≤å Î¨∏ÏùòÌï¥Ï£ºÏÑ∏Ïöî.");
      console.error("Error:", error);
    }
  };

  const handleAddressSearch = () => {
    if (!isKakaoLoaded || !isPostcodeLoaded) {
      alert(
        "üö® Ïπ¥Ïπ¥Ïò§Îßµ API ÎòêÎäî Ïö∞Ìé∏Î≤àÌò∏ APIÍ∞Ä ÏïÑÏßÅ ÏôÑÏ†ÑÌûà Î°úÎìúÎêòÏßÄ ÏïäÏïòÏäµÎãàÎã§. Ïû†Ïãú ÌõÑ Îã§Ïãú ÏãúÎèÑÌï¥Ï£ºÏÑ∏Ïöî."
      );
      return;
    }

    if (!window.daum || !window.daum.Postcode) {
      alert(
        "üö® Ïö∞Ìé∏Î≤àÌò∏ Í≤ÄÏÉâ APIÍ∞Ä ÏïÑÏßÅ Î°úÎìúÎêòÏßÄ ÏïäÏïòÏäµÎãàÎã§. ÏÉàÎ°úÍ≥†Ïπ® ÌõÑ Îã§Ïãú ÏãúÎèÑÌï¥Ï£ºÏÑ∏Ïöî."
      );
      return;
    }

    new window.daum.Postcode({
      oncomplete: function (data) {
        setUserInfo({ ...userInfo, region1: data.sido, region2: data.sigungu });
      },
    }).open();
  };

  return (
    <div className={styles["Register_Container"]}>
      <div className={styles["Main_container"]}>
        <div className={styles["Main_image"]}>
          <img src="/image/RegisterImage.jpg" alt="Background" className={styles["RegisterImage"]} />
          <img src="/image/Vector9.png" alt="Overlay" className={styles["RegisterImage_Vector"]} />
        </div>
      </div>
      <h2 className={styles["Register_Title"]}>SIGN UP</h2>
      <form className={styles["form"]} onSubmit={handleSubmit}>
        <div>
          <label className={styles["USERID"]}>UserId:</label>
          <input
            className={styles["input_text"]}
            type="text"
            name="userid"
            value={userInfo.userid}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label className={styles["PASSWORD"]}>Password:</label>
          <input
            className={styles["input_text"]}
            type="password"
            name="password"
            value={userInfo.password}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label className={styles["EMAIL"]}>Email:</label>
          <input
            className={styles["input_text"]}
            type="email"
            name="email"
            value={userInfo.email}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label className={styles["SEXUAL_SELECTION"]}>SEXUAL SELECTION</label>
          <div className={styles["gender-selection"]}>
            <label>
              <input
                type="radio"
                name="sex"
                value="1"
                checked={userInfo.sex === "1"}
                onChange={handleChange}
                required
              />
              ÎÇ®Ïûê
            </label>
            <label>
              <input
                type="radio"
                name="sex"
                value="2"
                checked={userInfo.sex === "2"}
                onChange={handleChange}
                required
              />
              Ïó¨Ïûê
            </label>
          </div>
        </div>
        <div>
          <label className={styles["PROVINCE"]}>Province:</label>
          <input className={styles["input_text"]} type="text" name="region1" value={userInfo.region1} readOnly />
        </div>
        <div>
          <label className={styles["CITY"]}>City:
          <button className={styles["CITY_Button"]} type="button" onClick={handleAddressSearch}>
            Ï£ºÏÜå Í≤ÄÏÉâ
          </button>
          </label>
          <input className={styles["input_text"]} type="text" name="region2" value={userInfo.region2} readOnly />
        </div>
        <div>
          <label className={styles["BIRTH"]}>Birth:</label>
          <input
            className={styles["input_text"]}
            type="date"
            name="birth"
            value={userInfo.birth}
            onChange={handleChange}
            min={minBirthDate.toISOString().split("T")[0]} // ÏµúÎåÄ 100ÎÖÑ Ï†ÑÍπåÏßÄ ÏûÖÎ†• Í∞ÄÎä•
